import React from 'react';
import Header from "./Header";
import {connect} from "react-redux";
import {SetAuth} from "../../Readux/Reducer-Auth";
import axios from "axios";
import s from "./Header.module.css";
import {NavLink} from "react-router-dom";
class HeaderContainer extends React.Component {
    componentDidMount() {

        axios.get(`https://social-network.samuraijs.com/api/1.0/auth/me`).then(response => {
            console.log('afdafasf')
            this.props.SetAuth(response.data)
        })
    }

    render(){
        return   <header className={s.main} >
            <div><img className={s.logo}
                      src="https://upload.wikimedia.org/wikipedia/commons/thumb/a/a7/React-icon.svg/1280px-React-icon.svg.png"/>
            </div>
            <div className={s.wrapper_login}>
                <NavLink className={s.login} to="/login" >login</NavLink>
            </div>

        </header>
    }
}
let mapStateToProps = (state)=>{
    return{
        user: state.Auth
    }
}
export default connect (mapStateToProps,{SetAuth})(HeaderContainer)
